package main

import (
	"fmt"

	"github.com/gogo/protobuf/proto"
	ngrpc "github.com/tgrpc/ngrpc/extension"
	"github.com/tgrpc/desc"
)

var (
	rawDescs = []string{"", "H4sIAAAAAAAC/+KSTK0oSc0rzszP04ez9AqK8kvyhTjhAlIK6fn56TmpEImk0jT9lNTi5KLMgpL8IoiYkhYXn0dJSUFQanGJf0FJZn6ekAQXe0FRalpaZoUEowKjBmcQjGsVyMVSlFpcIiSvh2asXnBqUVlmcirEhGKJpd8ucCowanAbSeohHIdqTRDYKCfDKP30zJKM0iS95Pxc/ZL0ooJk/TwwmZGak5Nfnl+Uk6IP4sLNSWID22oMCAAA///Ja1sdAgEAAA==", ""}
)

func main() {
	fileset, err := desc.DecodeGoGoFileDescriptorSetByBase64Str("", rawDescs)
	if err != nil {
		fmt.Printf("%+v", err)
		return
	}
	for _, file := range fileset.File {
		fmt.Println(file.GetName())
		if file.GetName() != "helloworld/greeter.proto" {
			continue
		}
		for _, service := range file.Service {
			fmt.Println("service.Name: ", service.GetName())
			os1, err := proto.GetExtension(service.GetOptions(), ngrpc.E_Rest)
			fmt.Println(os1, err)
			opt := os1.(*ngrpc.HttpRestOption)
			fmt.Printf("option: %+v\n", opt)
		}
	}
}